Undisputed is a 2002 action thriller drama movie released through Miramax. It starred and was co-produced by Wesley Snipes, co-starring Ving Rhames.

The film was directed by Walter Hill, and written by David Giler and Hill, who is probably best known as the writer/director of 48 Hours and Streets of Fire, but had most recently directed Supernova. He and Giler had previously collaborated on the Alien series and Southern Comfort.

