Undisputed II: Last Man Standing is a 2006 direct-to-video sequel to the 2002 action film Undisputed. The film stars Michael Jai White, Scott Adkins, Eli Danker and Ben Cross, and was directed by Isaac Florentine. This film doesn't feature any of the cast members of the first film, which included, Wesley Snipes and Ving Rhames.
